import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'

function Navbar() {
    return (
        <div id="navbar">
            funny text that's hopefully centered
        </div>
    )
}

function Test() {
    return (
        <h1>a very (?) long header</h1>
    )
}

function Manytests() {
    return (
        <Test />,
        <Navbar />
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
